import { makeStyles } from '@material-ui/core'
import { SidePanelItem } from '../../Molecules/SidePanelItem/SidePanelItem'
import {viewMore,results} from '../../../Constants/constants'
import { SearchBar } from '../../Atoms/SearchBar/SearchBar'
import Icon from '../../Atoms/Icon/Icon'
import TypographyComponent from '../../Atoms/Typography/TypographyComponent'


export type templateListProps = {
    imageListSrc:string[];
}

export const TemplateList = (props: templateListProps) => {
    const{imageListSrc}=props
  const useStyles = makeStyles((theme) => ({
    Item: {},
  }))

  const classes = useStyles()
  return (
    <Grid
      container
      direction="column"
      spacing={1}
      style={{
        width: '296px',
        height: '704px',
        backgroundColor:'#F3F2F7'
      }}
    >
      <Grid item><SearchBar></SearchBar></Grid>
      <Grid item>
        <Grid container direction='row' spacing={3}>
            <Grid item><TypographyComponent>{results}</TypographyComponent></Grid>
            <Grid item>{viewMore}</Grid>
        </Grid>
      </Grid>
      <Grid item>
      {imageListSrc.map((item: string, index: number) => { 
return(
    <Grid item >

<Icon imageSrc={item}></Icon>
</Grid>
)})}
      </Grid>


    </Grid>
  )
}
